import React, {useRef, useEffect} from 'react';



const Inventory = () => {


    let itemName = useRef();
    useEffect(() => {
        itemName.current.focus();
    },[])


    return (
        <div className='container'>
            <h1 className='title text-center'>Inventory List</h1>
            <form className='d-flex'>
                <div className='form-group m-1'>
                    <input placeholder='Item Name'
                    ref={itemName} />
                </div>
                <div>
                    <input placeholder='Item Quantity' />
                </div>
                <div>
                    <input placeholder='Item Price' />
                </div>
                <button className='btn btn-primary'>Save</button>
            </form>
            <ul className='container text-left'>
                <li className='d-flex space-between nb-1' style={{borderBottom: "1px solid #333"}}>
                    Name Quantity Price
                    <div>
                        <button className='btn btn-dark btn-sm'>Edit</button>
                        <button className='btn btn-danger btn-sm'>Delete</button>
                    </div>
                </li>
            </ul>
        </div>
    );
}
export default Inventory;
